import React from 'react';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';


const menu_bar = () => {
    return (
        <nav className="nav">
          <ul>
              <li><a>
              <FontAwesomeIcon icon="coffee" />
                  Home
                 </a>
                </li>
          </ul>
        </nav>
    );
};

export default menu_bar;
